  - uid: 'excel!Excel.FunctionResult#toJSON:member(1)'
    summary: 'Reemplaza el método JavaScript `toJSON()` para proporcionar un resultado más útil cuando se pasa un objeto API a`JSON.stringify()`<!-- -->. (`JSON.stringify`<!-- -->, a su vez, llama `toJSON` al método del objeto que se le pasa.) Mientras que el objeto<T> FunctionResult original es un objeto API, `toJSON` el método devuelve un objeto JavaScript sin formato (escrito como`Interfaces.FunctionResultData<T>`<!-- -->) que contiene copias rasas de las propiedades secundarias cargadas del objeto original.'
